  }, []);

  if (userInfo == null || restaurantData == null) {
    return null;
  }

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route
          path="/"
          element={<Map userInfo={userInfo} restaurantData={restaurantData} />}
        />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
